import React from 'react';
import LayoutAuthentication from '../layout/LayoutAuthentication';
import { Link } from 'react-router-dom';

const SignUpPage = () => {
    return <LayoutAuthentication heading = "SignUp">
       <p className='mb-6 text-xs font-normal text-center lg:text-sm text-text3 lg:mb-8'>Already have an account?{""}
       <Link to="/sign-in" className='font-medium underline text-primary'>
        Sign in
       </Link> </p>
       <button className="flex items-center gap-x-2 w"></button>
    </LayoutAuthentication>
};

export default SignUpPage;
